import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg custom-navbar">
      <div className="container">
        <Link className="navbar-brand fw-bold text-white" to="/">PMUY</Link>
        <div className="collapse navbar-collapse">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><Link className="nav-link text-white" to="/">Home</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/apply">Apply</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/status">Check Status</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/admin">Admin Panel</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
